leetcode/5429数组中的 k 个最强值.html.body:
给你一个整数数组 arr 和一个整数 k 。
设 m 为数组的中位数，只要满足下述两个前提之一，就可以判定 arr[i] 的值比 arr[j] 的值更强：
 |arr[i] - m| > |arr[j] - m|
 |arr[i] - m| == |arr[j] - m|，且 arr[i] > arr[j]
请返回由数组中最强的 k 个值组成的列表。答案可以以 任意顺序 返回。
class Solution {
public:
    vector getStrongest(vector& arr, int k) {
        vector res(k, 0);
        sort(arr.begin(), arr.end());
        int mid = arr[(arr.size() - 1) / 2];
        auto isStronger = [mid](int a, int b) {
            return (abs(a - mid) > abs(b - mid)) 
                    || (abs(a - mid) == abs(b - mid) && a > b);
        };
        priority_queue, decltype(isStronger)> que(isStronger);
        for (int num : arr) {
            que.push(num);
            if (que.size() > k) {
                que.pop();
            }
        }
        for(int i = k-1; i >= 0; i--){
          res[i] = que.top();
          que.pop();
        }
        return res;
    }
};

leetcode/98验证二叉搜索树.html.body:
98 验证二叉树

给定一个二叉树，判断其是否是一个有效的二叉搜索树。
假设一个二叉搜索树具有如下特征：
节点的左子树只包含小于当前节点的数。
节点的右子树只包含大于当前节点的数。
所有左子树和右子树自身必须也是二叉搜索树。
class Solution {
public:
    int* last = NULL;
    bool isValidBST(TreeNode* root) {
        if (!root) return true;
        if(!isValidBST(root->left)) return false;
        if (last && *last>=root->val) return false;
        last = &root->val;
        if(!isValidBST(root->right)) return false;
        return true;
    };
};

